import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import {
  AppBar,
  Button,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Toolbar
  } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';
import { FolderIcon } from '@material-ui/icons/Folder';


import ThreatMap from './ThreatMap';

const StyledButton = withStyles({
  root: {
    color: "white"
  }
})(Button);

function App(){
  return(
    <BrowserRouter>
      <AppBar color="primary" position="sticky">
        <Toolbar>
          <StyledButton component={Link} to="/">Demo App</StyledButton>
        </Toolbar>
      </AppBar>
      <div>
     <List>
          <ListItem>
            <ListItemIcon>
              <FolderIcon />
            </ListItemIcon>
          <ListItemText
              primary="Single-line item"
          />
          </ListItem>
        </List>

        {/*<Button color="primary" component={Link} to="/network-threat-map">
          Network incidents near you
        </Button>
        */}
        <Switch>
          <Route path='/network-threat-map'>
            <ThreatMap />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
};

export default App;
